import styled from "styled-components";

import { IBenefit } from "@interfaces";
import { ModulesBenefitItem } from "@modules";
// import { CouponItem } from "./Item";

interface IProps {
    data: IBenefit[];
    handleClick: (id: string) => void;
    loadingPagination: boolean;
    handleLoadMore: () => void;
}

export const ComponentBenefitList = (props: IProps) => {
    const { data, handleClick, loadingPagination, handleLoadMore } = props;

    return (
        <StyledContainer>
            {data.map((item) => {
                return <ModulesBenefitItem handleClick={handleClick} data={item} key={item._id} />;
            })}
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    width: 90%;
    margin: 0 auto;
    padding: 25px 0;
    position: relative;
`;
